import { useParams } from "react-router-dom";

const Detailts = () => {
  const params = useParams();

  //prendere la key
  // sito da cui fare la fetch

  const getOmdbData = () => {
    fetch("http://www.omdbapi.com/?apikey=[PUT_YOUR_API_KEY_HERE]&i=tt0241527" + params.omdbId)
      .then((resp) => {
        if (resp.ok) {
          return resp.json();
        }
      })
      .then((movieData) => console.log(movieData));
  };

  console.log(params.omdbId);
  return (
    <div>
      <h1>Details</h1>
    </div>
  );
};

export default Detailts;
